  Package(
    name: 'Roboto Flex Font',
    description:
        ''' Roboto Flex upgrades Roboto so it becomes a more powerful typeface system. With Flex, you can customize Roboto to express and finesse your text in ways never before possible. Today, people are constantly switching between devices, resizing browsers, and spreading our viewports across multiple screens. So Google commissioned Font Bureau to re-imagine Roboto to “flex” along with us, with a special emphasis on large-screen capabilities. This was achieved by amplifying the original design to an extreme range of weights, grades, widths and optical sizes.

The second benefit of Roboto Flex is the designer’s ability to fitness and fine-tune their designs with parametric axes. Font Bureau first demonstrated the concept of parametric axes in Amstelvar Alpha (2017), to provide the ultimate in typographic flexibility. With early prototypes of Roboto Flex, Font Bureau demonstrated new solutions to the typographic problems that digital designers face. Demonstrations of high quality justification, better dark-mode typography and other uses of parametric axes are documented at variablefonts.typenetwork.com

The needs of developers, designers, and — of course — end-user readers were prioritized and aligned during development. To make Roboto Flex production-ready for all print and digital media, Font Bureau expanded the glyph set with careful planning and development, in partnership with script experts for Cyrillic and Greek. Rigorous testing of each glyph across every axis required new type design tools to be developed, like typetools and videoproof, which can be used to explore the depth of the design.

The final file size of the complete package is remarkably small, given the range of expressive styles now available. By driving variable fonts technology to its limits, it offers the most interesting and useful typographic tools for end users and designers. With a fully loaded Optical Size axis, Roboto Flex makes the layout of texts with deep hierarchies more straightforward and heightens the quality of every design that uses it.

And none of this would be possible without the long list of contributors involved. Special thanks to David Berlow, Santiago Orozco, Ilya Ruderman, Irene Vlachou, Yury Ostromentsky, Mikhail Strukov, Dave Crossland, Damien Correll, Marc Foley, David Jonathan Ross, Chris Lewis, Eben Sorkin, Viktoriya Grabowska, Adam Twardoch, Roel Nieksens, Laurence Penney, and Thomas Linard.

Roboto Flex is developed by Font Bureau for Google, based on the design initiated by Christian Robertson. To contribute, see https://github.com/googlefonts/roboto-flex''',
