  /// Whether the package is included in the SDK or not.
  final bool isSdk;

  /// Whether the package is a direct dependency or not.
  final bool isDirectDependency;

  /// Whether the package is a dev dependency or not.
  final bool isDevDependency;

  const Package({
    required this.name,
    required this.description,
    this.homepage,
    this.repository,
    required this.authors,
    required this.version,
    this.license,
    required this.isMarkdown,
    required this.isSdk,
